#include <stdlib.h>

/**
 * Note: The returned array must be malloced, assume caller calls free().
 */
int* numberGame(int* nums, int numsSize, int* returnSize) {
    *returnSize = numsSize;
    int* arr = (int*)malloc(numsSize * sizeof(int));
    if (!arr) return NULL; // Memory allocation check

    // Simple selection sort to sort nums array
    for (int i = 0; i < numsSize - 1; i++) {
        for (int j = i + 1; j < numsSize; j++) {
            if (nums[i] > nums[j]) {
                int temp = nums[i];
                nums[i] = nums[j];
                nums[j] = temp;
            }
        }
    }

    // Fill arr with elements from nums as per game rules
    // Bob's moves (even indices) are filled with elements from the end of nums
    // Alice's moves (odd indices) are filled with elements from the start of nums
    for (int i = 0, start = 0, end = numsSize - 1; i < numsSize; i += 2, start++, end--) {
        arr[i] = nums[end]; // Bob's move
        if (i + 1 < numsSize) arr[i + 1] = nums[start]; // Alice's move
    }

    return arr;
}
